var shape1, shape2 geom.T

func init() {
	shape1 = geom.Polygon{Rings: [][]geom.Point{{geom.Point{0, 0}, geom.Point{1, 0},
		geom.Point{1, 1}, geom.Point{0, 1}, geom.Point{0, 0}}}}
	shape2 = geom.Polygon{Rings: [][]geom.Point{{geom.Point{.25, .25},
		geom.Point{.75, .25}, geom.Point{.75, .75}, geom.Point{.25, .75},
		geom.Point{.25, .25}}}}
	gob.Register(geom.Polygon{})
	gob.Register(geom.Point{})
}

func TestArea(t *testing.T) {
	a := Area(shape1)
	if different(a, 1.) {
		t.Log(a)
		t.Fail()
	}
	a = Area(shape2)
	if different(a, 0.25) {
		t.Log(a)
		t.Fail()
	}
}

func TestDifference(t *testing.T) {
	FixOrientation(shape1)
	FixOrientation(shape2)
	shape, err := Construct(shape1, shape2, DIFFERENCE)
	handle(err)
	t.Log(shape)
	a := Area(shape)
	if different(a, 0.75) {
		t.Log(a)
		t.Fail()
	}
	drawShapes(shape2, shape1, shape, "difference.png")
}

func TestUnion(t *testing.T) {
	shape, err := Construct(shape1, shape2, UNION)
	handle(err)
	t.Log(shape)
	a := Area(shape)
	if different(a, 1.) {
		t.Log(a)
		t.Fail()
	}
	drawShapes(shape2, shape1, shape, "union.png")
}

func TestIntersection(t *testing.T) {
	shape, err := Construct(shape1, shape2, INTERSECTION)
	handle(err)
	t.Log(shape)
	a := Area(shape)
	if different(a, 0.25) {
		t.Log(a)
		t.Fail()
	}
	drawShapes(shape2, shape1, shape, "intersection.png")
}

