func TestWithin1(t *testing.T) {
	f, err := os.Open("testData/cell1.gob")
	handle(err)
	g := gob.NewDecoder(f)
	var cell geom.Point
	err = g.Decode(&cell)
	handle(err)
	f.Close()
	f, err = os.Open("testData/tzs1.gob")
	handle(err)
	g = gob.NewDecoder(f)
	var tzs []geom.T
	err = g.Decode(&tzs)
	handle(err)
	f.Close()
	for i, tz := range tzs {
		//c, err := Centroid(cell)
		//handle(err)
		t.Log(i, orientation(tz.(geom.Polygon)))
		err = FixOrientation(tz)
		handle(err)
		in, err := Within(cell, tz)
		handle(err)
		t.Log(i, in, orientation(tz.(geom.Polygon)))
		switch i {
		case 0:
			if in {
				t.Fail()
			}
		case 1:
			if in {
				t.Fail()
			}
		case 2:
			if !in {
				t.Fail()
			}
		case 3:
			if in {
				t.Fail()
			}
		}
		drawShapes(cell, tz, nil, fmt.Sprintf("testWithin1_%v.png", i))
	}
}

func TestCentroid(t *testing.T) {
	shape := geom.T(geom.Polygon{[][]geom.Point{
		{{0, 0}, {1, 0}, {2, 1}, {2, 2}, {1, 3}, {0, 3}, {-1, 2}, {-1, 1}, {0, 0}},
		{{0, 0.1}, {0.9, 2.7}, {1.9, 1.5}, {0.75, 0.1}, {0, 0.1}}}})
	point, err := Centroid(shape)
	handle(err)
	t.Log(point)
	drawShapes(shape, nil, point, "centroid.png")
}

